import { Parallax } from 'react-parallax';
import MacintoshParallax from '../pic/macintosh.jpg'

const MacintoshPar = () => (
    <Parallax className="image" bgImage={MacintoshParallax} strength={800}>
        <div className="content">
            <span className="img-txt"> Aхуенно! </span>
        </div>
    </Parallax>
);

export default MacintoshPar;
